import {useState} from 'react'
export default function App(){
    const [resarr,setalphabet]=useState(()=>generateAlphabets())
    function generateAlphabets(){
        let alphabets = 'abcdefghijklmnopqrstuvwxyz'
        let resarr=[]
        for(let i=1;i<=26;i++){
            resarr.push({
                value: alphabets[i],
                isClick: "white",
                index: i
            })
        }
        return resarr
    }
    console.log(resarr)
    return(
        <>
            <h1>App</h1>
            <Letters />
        </>
    )
}
